import { NextPage } from 'next';
import styled from "styled-components";
import Header from "./Header";
import Sidebar from "./Sidebar";

const withLayout = (Page: NextPage) => {
  return () => (
    <div>
      <Header/>
      <div>
        <Sidebar/>
        <Page />
      </div>
    </div>
  )
}

export default withLayout
